import { StyledNavbar, Title, NumbTaskStyle } from "./navbarStyle";

export default function Navbar() {
  return (
    <StyledNavbar>
      <Title>Tone</Title>
      <NumbTaskStyle>
        <span>Tasks:</span> 15
      </NumbTaskStyle>
    </StyledNavbar>
  );
}
